  "translationLines": [
    {
      "lineNumber": 187972,
      "originalJapaneseLine": "　分かりやすく言え」",
      "translatedEnglishLine": "\"Say it in a way that's easy to understand.\""
    },
    {
      "lineNumber": 187973,
      "originalJapaneseLine": "「素晴らしくも大がかりな",
      "translatedEnglishLine": "\"It's a wonderful and elaborate"
    },
    {
      "lineNumber": 187974,
      "originalJapaneseLine": "　封印技術が使われてるなあ」",
      "translatedEnglishLine": "sealing technique being used here.\""
    },
    {
      "lineNumber": 187975,
      "originalJapaneseLine": "「ん、最初からそう言え」",
      "translatedEnglishLine": "\"Hmm, you should have said so from the start.\""
    },
    {
      "lineNumber": 187976,
      "originalJapaneseLine": "「それよりカミーラだが……",
      "translatedEnglishLine": "\"More importantly, about Camilla...\""
    },
    {
      "lineNumber": 187977,
      "originalJapaneseLine": "　お前、本気でアレと、その……",
      "translatedEnglishLine": "You, are you seriously going to do that and, uh..."
    },
    {
      "lineNumber": 187978,
      "originalJapaneseLine": "　せ、せ……",
      "translatedEnglishLine": "Se, se..."
    },
    {
      "lineNumber": 187979,
      "originalJapaneseLine": "「セックスか？",
      "translatedEnglishLine": "\"Sex?\""
    },
    {
      "lineNumber": 187980,
      "originalJapaneseLine": "　おう、するつもりだぞ」",
      "translatedEnglishLine": "Yeah, I intend to.\""
    },
    {
      "lineNumber": 187981,
      "originalJapaneseLine": "「こ、この、不埒な……！」",
      "translatedEnglishLine": "\"Y-You shameless...!\""
    },
    {
      "lineNumber": 187982,
      "originalJapaneseLine": "「それより殺そう、",
      "translatedEnglishLine": "\"More importantly, let's kill her,"
    },
    {
      "lineNumber": 187983,
      "originalJapaneseLine": "　すぐに殺そう、",
      "translatedEnglishLine": "kill her immediately,"
    },
    {
      "lineNumber": 187984,
      "originalJapaneseLine": "　さっさと殺そう」",
      "translatedEnglishLine": "quickly kill her.\""
    },
    {
      "lineNumber": 187985,
      "originalJapaneseLine": "「あれは……危険な女だ」",
      "translatedEnglishLine": "\"That woman... is dangerous.\""
    },
    {
      "lineNumber": 187986,
      "originalJapaneseLine": "「がははは、可愛い女ではないか！",
      "translatedEnglishLine": "\"Gahaha, isn't she a cute woman!"
    },
    {
      "lineNumber": 187987,
      "originalJapaneseLine": "　殺すなんてもったいない！」",
      "translatedEnglishLine": "It would be a waste to kill her!\""
    },
    {
      "lineNumber": 187988,
      "originalJapaneseLine": "「うう……ランス様、",
      "translatedEnglishLine": "\"Uu... Lord Rance,"
    },
    {
      "lineNumber": 187989,
      "originalJapaneseLine": "　やっぱり会いに行くのは危険では……」",
      "translatedEnglishLine": "isn’t it dangerous to go meet her after all...?\""
    },
    {
      "lineNumber": 187990,
      "originalJapaneseLine": "「おらもあのカミーラは怖いだす……",
      "translatedEnglishLine": "\"I'm also scared of that Camilla..."
    },
    {
      "lineNumber": 187991,
      "originalJapaneseLine": "　出来れば二度と近づきたくは……」",
      "translatedEnglishLine": "I’d rather not get near her again if I can help it...\""
    },
    {
      "lineNumber": 187992,
      "originalJapaneseLine": "「ぐふふ、会ったらまずは何をするかなー……」",
      "translatedEnglishLine": "\"Gufufu, I wonder what I'll do first when I meet her...\""
    },
    {
      "lineNumber": 187993,
      "originalJapaneseLine": "「うう……聞いてくれてないだす……」",
      "translatedEnglishLine": "\"Uu... you’re not listening to me...\""
    },
    {
      "lineNumber": 187994,
      "originalJapaneseLine": "「ですが……",
      "translatedEnglishLine": "\"But...\""
    },
    {
      "lineNumber": 187995,
      "originalJapaneseLine": "「ここは魔法大国ゼスが作った最大級の封印施設。",
      "translatedEnglishLine": "\"This is the largest sealing facility built by the great magical nation Zeth."
    },
    {
      "lineNumber": 187996,
      "originalJapaneseLine": "　魔人カミーラのもとに行くだけでも",
      "translatedEnglishLine": "Just going to the demon Camilla’s place"
    },
    {
      "lineNumber": 187997,
      "originalJapaneseLine": "　大変ですよ……」",
      "translatedEnglishLine": "is difficult...\""
    },
    {
      "lineNumber": 187998,
      "originalJapaneseLine": "「がははは、俺様なら楽勝だ！",
      "translatedEnglishLine": "\"Gahaha, if it’s me, it’s a piece of cake!"
    },
    {
      "lineNumber": 187999,
      "originalJapaneseLine": "　カミーラと会う為ならこの程度！」",
      "translatedEnglishLine": "If it’s to meet Camilla, this much is nothing!\""
    },
    {
      "lineNumber": 188000,
      "originalJapaneseLine": "「よし、行くぞ！」",
      "translatedEnglishLine": "\"Alright, let’s go!\""
    },
    {
      "lineNumber": 188001,
      "originalJapaneseLine": "　",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 188002,
      "originalJapaneseLine": "　　＜ビーーーーー！　ビーーーーー！＞",
      "translatedEnglishLine": "<Beeeeeeep! Beeeeeeep!>"
    },
    {
      "lineNumber": 188003,
      "originalJapaneseLine": "「うおっ、警報！？」",
      "translatedEnglishLine": "\"Whoa, an alarm!?\""
    },
    {
      "lineNumber": 188004,
      "originalJapaneseLine": "「侵入者アリ！　侵入者アリ！",
      "translatedEnglishLine": "\"Intruder alert! Intruder alert!"
    },
    {
      "lineNumber": 188005,
      "originalJapaneseLine": "　警備班は至急向かって下さい！」",
      "translatedEnglishLine": "Security teams, please respond immediately!\""
    },
    {
      "lineNumber": 188006,
      "originalJapaneseLine": "「……俺達のことか？」",
      "translatedEnglishLine": "\"...Is that about us?\""
    },
    {
      "lineNumber": 188007,
      "originalJapaneseLine": "「いえ、そんな筈はありません」",
      "translatedEnglishLine": "\"No, that can’t be.\""
    },
    {
      "lineNumber": 188008,
      "originalJapaneseLine": "千鶴子は既に情報魔法を駆使して、",
      "translatedEnglishLine": "Chizuko was already using her information magic,"
    },
    {
      "lineNumber": 188009,
      "originalJapaneseLine": "本部と連絡を取っていた。",
      "translatedEnglishLine": "and had communicated with headquarters."
    },
    {
      "lineNumber": 188010,
      "originalJapaneseLine": "「警報の理由が分かりました……」",
      "translatedEnglishLine": "\"I’ve found out the reason for the alarm...\""
    },
    {
      "lineNumber": 188011,
      "originalJapaneseLine": "「魔軍です」",
      "translatedEnglishLine": "\"It’s the demon army.\""
    },
    {
      "lineNumber": 188012,
      "originalJapaneseLine": "「なんですって！？」",
      "translatedEnglishLine": "\"What!?\""
    },
    {
      "lineNumber": 188013,
      "originalJapaneseLine": "「魔軍が別の場所より、",
      "translatedEnglishLine": "\"The demon army, from another location,"
    },
    {
      "lineNumber": 188014,
      "originalJapaneseLine": "　この永久牢ブロックに侵入を……",
      "translatedEnglishLine": "is invading this permanent prison block..."
    },
    {
      "lineNumber": 188015,
      "originalJapaneseLine": "　まず、間違いなく目的は――」",
      "translatedEnglishLine": "Their goal is undoubtedly—\""
    },
    {
      "lineNumber": 188016,
      "originalJapaneseLine": "「カミーラ、か」",
      "translatedEnglishLine": "\"Camilla, huh.\""
    },
    {
      "lineNumber": 188017,
      "originalJapaneseLine": "「くっ、まさかこの中がバレるなんて……！」",
      "translatedEnglishLine": "\"Damn it, I can’t believe they found out what’s inside here...!\""
    },
    {
      "lineNumber": 188018,
      "originalJapaneseLine": "「お前ら急ぐぞ！　こっからは競争だ！」",
      "translatedEnglishLine": "\"You guys, hurry up! From here on it’s a race!\""
    },
    {
      "lineNumber": 188019,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "............"
    },
    {
      "lineNumber": 188020,
      "originalJapaneseLine": "……",
      "translatedEnglishLine": "..."
    },
    {
      "lineNumber": 188021,
      "originalJapaneseLine": "永久地下牢、ランス達がいる場所とは",
      "translatedEnglishLine": "At the permanent underground prison, separate from where Rance and the others are,"
    },
    {
      "lineNumber": 188022,
      "originalJapaneseLine": "別の地点では150名からなる、",
      "translatedEnglishLine": "from another point, a 150-member elite demon army"
    },
    {
      "lineNumber": 188023,
      "originalJapaneseLine": "魔軍の精鋭部隊が奥を目指し進む。",
      "translatedEnglishLine": "advanced toward the depths."
    },
    {
      "lineNumber": 188024,
      "originalJapaneseLine": "その先頭を歩く集団が",
      "translatedEnglishLine": "The group walking at the front"
    },
    {
      "lineNumber": 188025,
      "originalJapaneseLine": "元気いっぱいに歌っていた。",
      "translatedEnglishLine": "was singing energetically."
    },
    {
      "lineNumber": 188026,
      "originalJapaneseLine": "「ワーーーンワンワンワン♪」",
      "translatedEnglishLine": "\"Waan waan waan waan♪\""
    },
    {
      "lineNumber": 188027,
      "originalJapaneseLine": "「わんわんわん（合いの手）」",
      "translatedEnglishLine": "\"Wan wan wan (call and response)\""
    },
    {
      "lineNumber": 188028,
      "originalJapaneseLine": "「ワンのワンのワンワワン♪",
      "translatedEnglishLine": "\"Wan no wan no wan wawan♪"
    },
    {
      "lineNumber": 188029,
      "originalJapaneseLine": "　ワーーーーン、ワンワン♪」",
      "translatedEnglishLine": "Waaaan, wan wan♪\""
    },
    {
      "lineNumber": 188030,
      "originalJapaneseLine": "「わんわんわん（合いの手）」",
      "translatedEnglishLine": "\"Wan wan wan (call and response)\""
    },
    {
      "lineNumber": 188031,
      "originalJapaneseLine": "「…………はあ」",
      "translatedEnglishLine": "\"...Haa.\""
    }
  ]
}

